INSERT INTO `conmodelodocumentos` VALUES (2,'02','01','CERTIFICADO LABORAL - ACTIVO','<i>CERTIFICA</i>\r\n&seccion&\r\n<p style=\"text-align: justify\">Que %tipoSexo%,<b>%nombres%, %identificado% </b>\r\n        con %tipoDocumento%  No <b> %numCedula% ,</b> labora en ésta empresa desde\r\n        <b>el %fechaIngreso%,</b> desempeñando el cargo de <b>%cargo%</b>\r\n        en <b>%lugarLabora%,</b>\r\n        en la ciudad de Bogotá, con un sueldo Básico de <b>%sueldo%</b>\r\n        (%sueldoLetras% Mcte),con un contrato %tipoContrato%\r\n         y no presenta ningún embargo.</p>\r\n        <p >Para mayor constancia se firma en Montería a los %fechaActual%</p>\r\n\r\n        &seccion&\r\n\r\n        <p>Atentamente,\r\n        <br>\r\n        </p><p>\r\n        ___________________________<br>\r\n        <b>Maria Fernanda Jimenez O</b>\r\n        <br>\r\n        Dir. Recursos Humanos</p>\r\n        &seccion&\r\n\r\n        <hr  style=\" border-style:solid;border-width: 3px;\">\r\n        <p style=\"text-align: center\">Carrera 6 No. 77-86  Montería  Colombia  South América\r\n        <br>\r\n        PBX: 7854601 - 7853966 </p>','2018-09-26',2,2,'A','A',NULL,'ADMINISTRADOR','2018-09-26 09:56:20','ADMINISTRADOR','2018-09-26 09:57:54',NULL,NULL,NULL,NULL),(3,'02','02','CERTIFICADO LABORAL - INACTIVOS','<i>CERTIFICA</i>\r\n        &seccion&\r\n        <p style=\"text-align: justify\">Que %tipoSexo%,<b>%nombres%, %identificado% </b>\r\n                con %tipoDocumento% No <b> %numCedula% ,</b> laboró en ésta empresa desde\r\n                <b>el %fechaIngreso%,</b> en el cargo de <b>%cargo%</b>\r\n                , hasta el día  %fechaRetiro%\r\n                en <b>%lugarLabora%,</b>\r\n                en la ciudad de Bogotá, con un contrato %tipoContrato%\r\n                 y no presenta ningún embargo.</p>\r\n                <p >Para mayor constancia se firma en Montería a los %fechaActual%</p>\r\n\r\n                &seccion&\r\n\r\n                <p>Atentamente,\r\n                <br>\r\n                </p><p>\r\n                ______________________________<br>\r\n                <b>Maria Fernanda Jimenez O</b>\r\n                <br>\r\n                Dir. Recursos Humanos</p>\r\n                &seccion&\r\n\r\n                <hr  style=\" border-style:solid;border-width: 3px;\">\r\n                <p style=\"text-align: center\">Carrera 6 No. 77-86  Montería  Colombia  South América\r\n                <br>\r\n                PBX: 7854601 - 7853966 </p>','2018-09-26',2,2,'A','A',NULL,'ADMINISTRADOR','2018-09-26 09:57:57','ADMINISTRADOR','2018-09-26 09:59:26',NULL,NULL,NULL,NULL),(5,'02','03','CERTIFICADO LABORAL - ACTIVO - TIEMPO','<br>\r\n<br>\r\n<br>\r\n<table align=\"right\">\r\n<tr><td align=\"right\"><b>&NumeracionDocumento&</b></td></tr>\r\n</table>\r\n<br><br>\r\n<b><center>&NombreEmpresaCompleto&</center></b>\r\n<b><center> &NombreEmpresa&</center></b>\r\n<b><center> &NitEmpresa& </center></b>\r\n<br>\r\n<br>\r\n<br>\r\n<b><center> CERTIFICA QUE</center></b>\r\n<br>\r\n<br>\r\n&Señor(a)& &NombreTrabajador& &IdentificadoTrabajador& &CedulaTrabajador& &CiudadExpedicionCedulaTrabajador& - &DptoExpedicionCedulaTrabajador&, labora en esta empresa  por un periodo de &PeriodoLaboral&, a partir de la fecha &FechaIngresoTrabajador&, en el cargo de <b>&CargoTrabajador&</b>.\r\n<br><br><br>\r\nLa constancia se firma en Montería, a los &DiaFirmaDocumentoTexto& del mes  &MesFirmaDocumentoTexto& de &AñoFirmaDocumentoNumero&\r\n<br>\r\n<br>\r\n<br>\r\n<br>\r\n<br>\r\n<center>\r\n<IMG SRC=\'FirmaB.jpg\' align=\'center\'/>\r\n<br>\r\n___________________________________\r\n<br>\r\n<b>&ResponsableFirmaDocumento&</b>\r\n<br><br>\r\n&CargoResponsableFirmaDocumento&\r\n</center>\r\n<br><br><br><br><br><br><br><br><br><br><br><br><br><br><br><br><br>\r\n<table align=\"right\">\r\n<tr><td align=\"right\">\r\n______________________________________________</td></tr>\r\n<tr><td align=\"right\">&DireccionEmpresaTelefono&</td></tr>\r\n<tr><td align=\"right\">&CorreoElectronicoEmpresa&</td></tr>\r\n<tr><td align=\"right\">Montería - Córdoba</td></tr>\r\n</table>\r\n\r\n\r\n','2018-10-03',2,2,'I','A',NULL,'ADMINISTRADOR','2018-10-03 16:14:59','ADMINISTRADOR','2018-10-03 16:19:28',NULL,NULL,NULL,NULL),(6,'02','04','CERTIFICADO LABORAL - INACTIVO - TIEMPO','<br>\r\n<br>\r\n<br>\r\n<table align=\"right\">\r\n<tr><td align=\"right\"><b>&NumeracionDocumento&</b></td></tr>\r\n</table>\r\n<br><br>\r\n<b><center>&NombreEmpresaCompleto&</center></b>\r\n<b><center> &NombreEmpresa&</center></b>\r\n<b><center> &NitEmpresa& </center></b>\r\n<br>\r\n<br>\r\n<br>\r\n<b><center> CERTIFICA QUE</center></b>\r\n<br>\r\n<br>\r\n&Señor(a)Inactivo&  &NombreTrabajadorInactivo& &IdentificadoTrabajadorInactivo& &CedulaTrabajadorInactivo& &CiudadExpedicionCedulaTrabajadorInactivo& - &DptoExpedicionCedulaTrabajadorInactivo&, laboró en esta empresa por un periodo de &PeriodoLaboral&, en el cargo de <b>&CargoTrabajadorInactivo&</b>\r\n<br><br>\r\nSu desempeño durante la permanencia en la empresa fue excelente. comportandose como una persona seria y cumplidora de su deber como trabajador . laborando en el periodo comprendido.\r\n<br><br>\r\n<table COLSPAN=5 WIDTH=\"100%\" BORDER=\"1\">\r\n<tr>\r\n<th WIDTH=\"50%\" ALIGN=\"enter\" ><b>DESDE </b></th>\r\n<th WIDTH=\"50%\" ALIGN=\"enter\" ><b>HASTA</b></th>\r\n</tr>\r\n&FechaInicialExtrabajador& \r\n</table>\r\n\r\n<br><br><br>\r\nPara mayor constancia se firma en la ciudad de Montería, a los &DiaFirmaDocumentoTexto& del mes  &MesFirmaDocumentoTexto& de &AñoFirmaDocumentoNumero&\r\n<br>\r\n<br>\r\nCordialmente,\r\n<br>\r\n<br>\r\n<br>\r\n<br>\r\n<br>\r\n<center>\r\n<IMG SRC=\'FirmaB.jpg\' align=\'center\'/>\r\n<br>\r\n___________________________________\r\n<br>\r\n<b>&ResponsableFirmaDocumento&</b>\r\n<br><br>\r\n&CargoResponsableFirmaDocumento&\r\n </center>\r\n<br><br><br><br><br><br><br><br><br><br><br><br><br><br><br><br><br>\r\n<table align=\"right\">\r\n<tr><td align=\"right\">\r\n______________________________________________</td></tr>\r\n<tr><td align=\"right\">&DireccionEmpresaTelefono&</td></tr>\r\n<tr><td align=\"right\">&CorreoElectronicoEmpresa&</td></tr>\r\n<tr><td align=\"right\">Montería - Córdoba</td></tr>\r\n</table>\r\n','2018-10-03',2,2,'I','A',NULL,'ADMINISTRADOR','2018-10-03 16:19:32','ADMINISTRADOR','2018-10-03 16:21:18',NULL,NULL,NULL,NULL),(1,'03','01','CONTRATO DE TRANSPORTE DE PASAJEROS','<center><b>CONTRATO DE TRANSPORTE DE PASAJEROS No. &NumContrato& </b></center><br>\r\nEntre los suscritos a saber &NombreContratante&,  mayor de edad, vecino y residente en la ciudad &CiudadUbicacionContratante&,   &IdentificadoContratante& No &CedulaContratante& &CiudadExpedicionCedulaContratante&,  quien en adelante se denominará  <b>EL CONTRATANTE</b>  y <b>&NombreEmpresa&</b>, sociedad legalmente constituida inscrita en  la Cámara de Comercio, identificada con NIT. &NitEmpresa&, representada legalmente en la ciudad de Montería, por  <b> &NombreDelRepresentanteLegal&</b> mayor de edad,   &IdentificadoDelRepresentanteLegal& &CedulaRepresentanteLegal& de &CiudadExpedicionCedulaRepresentanteLegal&, quien en adelante se denominará el <b>CONTRATISTA</b>,  hemos celebrado el presente contrato de <b>Prestación del Servicio Público de Transporte Terrestre Automotor Especial con un Grupo Específico de Usuarios, </b>de acuerdo al <b>decretos 348 del 25/02/2015 - 431 de 14/03/2017 y demás normas legales relacionadas con este tipo de servicio</b>, el cual se regirá por las siguientes clausulas: \r\n<br><br>\r\n<b>PRIMERA: OBJETO DEL CONTRATO:</b> Prestar el servicio público terrestre automotor especial para trasladar a todas  las personas que hacen parte del grupo, cuya relación se encuentra adjunta haciendo parte integral de este contrato. \r\n<br><br>\r\n<b>SEGUNDA: ESPECIFICACIONES DE ORIGEN - DESTINO - N° DE PASAJEROS A MOVILIZAR  Y DURACIÓN DEL CONTRATO: </b>\r\n<br>ORIGEN: \r\n&CiudadOrigenViaje&\r\n<br>DESTINO: \r\n&CiudadDestinoViaje&\r\n<br>FECHA Y HORA SALIDA: \r\n&FechayHoraSalida&\r\n<br>FECHA Y HORA DE REGRESO: \r\n&FechayHoraRegresoViaje&\r\n<br>N° PASAJEROS: Ver listado Adjunto \r\n\r\n<br><br><b>TERCERA: VEHÍCULO:</b> Para la adecuada prestación de los servicios solicitados por el contratante, <b>EL CONTRATISTA</b> dispondrá del o los vehículos con las siguientes características: Propiedad de &NombrePropietario&,  <b>MARCA:</b> &MarcaVehiculo&&nbsp <b>CLASE:</b> &ClaseVehiculo& &nbsp <b>PLACA:</b> &PlacaVehiculo& &nbsp<b>MODELO:</b>&ModeloVehiculo& <b>N° PASAJEROS:</b>&CapacidadVehiculo& <b>SOAT:</b>&SoatVehiculo& <b>POLIZA RCC:</b> &PolizaVehiculoRCC& <b>POLIZA RCE:</b> &PolizaVehiculoRCE& <b>TMC:</b> \r\n&TecnomecanicaVehiculo&\r\n<br><br>\r\n<b>CUARTA: OBLIGACIONES.- DEL CONTRATISTA:</b> Son obligaciones del <b>CONTRATISTA</b>: <b>a)</b> Recoger y dejar en el sitio previamente establecido, a los usuarios  o particulares, pertenecientes al grupo específico del servicio contratado y en los horarios previamente establecidos por el <b>CONTRATANTE. b)</b> Contar con personal idóneo y calificado, que cumpla con los requisitos de movilidad. <b>c)</b> Realizar las actividades teniendo en cuenta las disposiciones legales dictadas por el Ministerio de transporte y Medio Ambiente, vigentes. <b>d)</b> Mantener el vehículo limpio y con las normas de seguridad exigidas por la ley. <b>e)</b> Cumplir con todos los requisitos para la libre circulación y prestación de servicio de transporte exigido por el Ministerio de Transporte, y demás entidades pertinentes. Éste requisito es aplicable tanto para los vehículos como para los conductores. \r\n<br><br>\r\n<b>QUINTA: OBLIGACIONES DEL CONTRATANTE:</b> Son obligaciones del <b>CONTRATANTE: a)</b> Informar claramente los lugares de origen y destino, con el fin de asignar apropiadamente la ruta de transporte. <b>b)</b> Informar por escrito, cualquier cambio de dirección con  &DiasCambioDireccion& días calendario de anticipación, con el objetivo de modificar la ruta de transporte. <b>c)</b> cancelar el servicio contratado según las disposiciones de este contrato.  \r\n<br><br>\r\n<b>SEXTA: CONDICIONES DEL Ó LOS VEHÍCULOS:</b> Las condiciones del vehículo deberán ser, las de contar con un radio de comunicación o teléfono portátil, botiquín de primeros auxilios y equipo de carretera; El vehículo deberá mantenerse en perfectas condiciones mecánicas, de mantenimiento, pintura, tapizado, aseo, higiene y presentación general; Cada vehículo deberá estar dotado de los elementos de seguridad exigidos por las autoridades de tránsito según la Ley 769/2002 art. 30, Acuerdo 051 de 1993 art. 116 del Ministerio de Transporte y demás que regule el Decreto 769/2002.                   \r\n<br><br>\r\n<b>SEPTIMA: VALOR DEL CONTRATO-</b> El valor total de este contrato será de  &ValorContratoServicioTexto& los cuales serán pagaderos de la siguiente manera: 50% del valor del servicio inicial y el saldo una vez finalizado el servicio transporte. <b>PARÁGRAFO:</b> En caso de presentarse algún cambio de lo estipulado en este contrato, como son: valores, cambios de ruta, etc., este cambio se hará constar mediante un <b>OTROSI</b>, el cual deberá anexarse seguido del acuerdo y firmas de las partes intervinientes.\r\n<br><br>\r\n<b>OCTAVA -CLAUSULA PENAL:</b> Las partes establecen como sanción pecuniaria a cargo de quien incumpla una o cualquiera de las estipulaciones derivadas de este contrato, la suma de &ValorIndenizacionContratoTexto&, cantidad de la cual será acreedora la otra.\r\n<br><br>\r\n<b>NOVENA: -TERMINACIÓN DEL CONTRATO:</b> Las partes podrán dar término a este contrato de manera unilateral o por mutuo acuerdo, mediante previo aviso por escrito de no menos de   &DiasTerminacionContrato& días de anticipación. \r\n<br>\r\nPara constancia se firma por las partes, en dos ejemplares, en la ciudad de Montería  a los  &DiaFirmaDocumentoTexto& días del mes de  &MesFirmaDocumentoTexto& del año  .&AñoFirmaDocumentoTexto& \r\n<br><br><br>\r\n<table>\r\n<tr> \r\n<td> &nbsp&nbsp&nbsp&nbsp&nbsp&nbsp&nbsp&nbsp&nbsp&nbsp&nbsp&nbsp&nbsp&nbsp&nbsp&nbsp&nbsp&nbsp&nbsp&nbsp&nbsp&nbsp&nbsp&nbsp&nbsp</td>\r\n<td><IMG SRC=\'FirmaJaime.jpg\'/></td>\r\n</tr>\r\n<br><br><br>\r\n<tr> \r\n<td> <b>CONTRATANTE   &nbsp&nbsp&nbsp&nbsp&nbsp&nbsp&nbsp&nbsp&nbsp&nbsp&nbsp&nbsp&nbsp&nbsp&nbsp&nbsp&nbsp&nbsp&nbsp&nbsp&nbsp&nbsp&nbsp&nbsp&nbsp</b></td>\r\n<td><b>CONTRATISTA </b></td>\r\n</tr>\r\n<tr> \r\n<td><b>&NombreContratante&  &nbsp&nbsp&nbsp&nbsp&nbsp&nbsp&nbsp&nbsp&nbsp&nbsp&nbsp&nbsp&nbsp&nbsp&nbsp&nbsp&nbsp&nbsp&nbsp&nbsp&nbsp&nbsp&nbsp&nbsp&nbsp</b></td>\r\n<td><b>&NombreDelRepresentanteLegal&</b></td>\r\n</tr>\r\n<tr> \r\n<td><b>C.C. &CedulaContratante& de &CiudadExpedicionCedulaContratante& \r\n&nbsp&nbsp&nbsp&nbsp&nbsp&nbsp&nbsp&nbsp&nbsp&nbsp&nbsp&nbsp&nbsp&nbsp&nbsp&nbsp&nbsp&nbsp&nbsp&nbsp&nbsp&nbsp&nbsp&nbsp &nbsp</b></td>\r\n<td><b>C.C. &CedulaRepresentanteLegal& de  &CiudadExpedicionCedulaRepresentanteLegal& </b></td>\r\n</tr>\r\n<tr> \r\n<td><b> &DireccionContratante& &nbsp&nbsp&nbsp&nbsp&nbsp&nbsp&nbsp&nbsp&nbsp&nbsp&nbsp&nbsp&nbsp&nbsp&nbsp&nbsp&nbsp&nbsp&nbsp&nbsp&nbsp&nbsp&nbsp&nbsp&nbsp</b></td>\r\n<td><b> Rep. Legal &NombreEmpresa&</b></td>\r\n</tr>\r\n<tr> \r\n<td><b>&TelefonoContratante& &nbsp&nbsp&nbsp&nbsp&nbsp&nbsp&nbsp&nbsp&nbsp&nbsp&nbsp&nbsp&nbsp&nbsp&nbsp&nbsp&nbsp&nbsp&nbsp&nbsp&nbsp&nbsp&nbsp&nbsp&nbsp</b></td>\r\n<td><b> NIT. &NitEmpresa& </b></td>\r\n</tr>\r\n<tr> \r\n<td><b> &CelularContratante& &nbsp&nbsp&nbsp&nbsp&nbsp&nbsp&nbsp&nbsp&nbsp&nbsp&nbsp&nbsp&nbsp&nbsp&nbsp&nbsp&nbsp&nbsp&nbsp&nbsp&nbsp&nbsp&nbsp&nbsp&nbsp</b></td>\r\n<td> Código de Comercio Decreto 2150/95</td>\r\n</tr>\r\n</table>\r\n<br>\r\n\r\n\r\n','2018-09-12',3,4,'I','A',NULL,'ADMINISTRADOR','2018-09-12 09:41:00','ADMINISTRADOR','2018-09-12 09:41:54',NULL,NULL,NULL,NULL),(4,'04','01','ENCUESTA SERVICIO ESPECIAL','<center><b>ENCUESTA SERVICIO ESPECIAL</b></center>\r\n<br>\r\n<b>Fecha:_________________      Placa Vehículo: &PlacaVehiculo& </b>\r\n<br><br>\r\n1. ¿ Cómo califica usted nuestro servicio?<br>&nbsp&nbsp&nbsp\r\n     a)  Excelente<br>&nbsp&nbsp&nbsp\r\n     b)  Bueno<br>&nbsp&nbsp&nbsp\r\n     c)  Regular<br> &nbsp&nbsp&nbsp\r\n     d)  Malo<br> &nbsp&nbsp&nbsp\r\n     e)  Pésimo<br>&nbsp&nbsp&nbsp\r\n<br>\r\n2. ¿ Cómo califica el trato de palabra y conducta por parte de los conductores y/o auxiliares en la prestación del servicio?<br>&nbsp&nbsp&nbsp\r\n     a)  Excelente<br>&nbsp&nbsp&nbsp\r\n     b)  Bueno<br>&nbsp&nbsp&nbsp\r\n     c)  Malo<br>&nbsp&nbsp&nbsp\r\n     d)  Regular<br>&nbsp&nbsp&nbsp\r\n     e)  Irrespetuoso<br>&nbsp&nbsp&nbsp\r\n<br>\r\n3. ¿ Cómo califica la limpieza y confort del vehiculo en que se le presta el servicio?<br>&nbsp&nbsp&nbsp\r\n     a)  Excelente<br>&nbsp&nbsp&nbsp\r\n     b)  Buena<br>&nbsp&nbsp&nbsp\r\n     c)  Mala<br>&nbsp&nbsp&nbsp\r\n     d)  Regular<br>&nbsp&nbsp&nbsp\r\n     e)  Pésima<br>&nbsp&nbsp&nbsp\r\n<br>\r\n4. ¿ Recomendarias el servicio especial que te presto Sotracor S.A. a otras personas?<br>&nbsp&nbsp&nbsp\r\n     a)  Si<br>&nbsp&nbsp&nbsp\r\n     b)  No<br>&nbsp&nbsp&nbsp\r\n     c)  Nunca<br>&nbsp&nbsp&nbsp\r\n<br>\r\n5. ¿ Durante el recorrido usted presencio fallas del vehiculo?<br>&nbsp&nbsp&nbsp\r\n     a)  Si<br>&nbsp&nbsp&nbsp\r\n     b)  No<br>&nbsp&nbsp&nbsp\r\n     c)  Algunas veces<br>&nbsp&nbsp&nbsp\r\n<br>\r\n6. ¿ Se siente seguro durante el viaje?<br>&nbsp&nbsp&nbsp\r\n     a)  Si<br>&nbsp&nbsp&nbsp\r\n     b)  No<br>&nbsp&nbsp&nbsp\r\n     c)  Algunas veces<br>&nbsp&nbsp&nbsp\r\n<br>\r\n7. ¿ Considera que la empresa cumple con los horarios establecidos?<br>&nbsp&nbsp&nbsp\r\n     a)  Si<br>&nbsp&nbsp&nbsp\r\n     b)  No<br>&nbsp&nbsp&nbsp\r\n     c)  A veces<br>&nbsp&nbsp&nbsp\r\n     d)  En cierta manera<br>&nbsp&nbsp&nbsp\r\n<br><br><br><br>\r\n<table align=\"right\">\r\n<tr><td align=\"right\">\r\n__________________________________________________________</td></tr>\r\n<tr><td align=\"right\">Calle 37 # 1B-42 Teléfonos 7822413-7824785 Montería -Córdoba</td></tr>\r\n</table>\r\n','2018-09-27',2,4,'I','A',NULL,'10775367','2018-09-27 09:49:44','10775367','2018-09-27 09:52:30',NULL,NULL,NULL,NULL);
